import React from "react";
import { RiHome4Line } from "react-icons/ri";

export default function SideBar() {
	return (
		<div className="fixed h-screen bg-teal-800 w-[334px] border-t border-black  grid grid-cols-2 lg:p-3 ">
			<div className="flex w-full flex-col gap-7">
				<div className="border-b bg-white w-full border-black ">
					<h1 className="font-bold">Main</h1>
					<div className="flex mr-auto font-bold cursor-pointer ">
						<RiHome4Line className="text-2xl font-extrabold" />
						<span>Home</span>
					</div>
				</div>
			</div>
		</div>
	);
}
